import React, { Component } from 'react'
import Table from '../table'
import {url} from '../../config'

export default class SubjectDetail extends Component {
    state = {
        data:[]
    };

    componentDidMount(){
        const {Class, SubjectCode, Date, Instructor} = this.props.data;
        //Convert from isoformat to 
        let date = Date.split('T')[0];
        fetch(url+`attendance/getAttendance/${Class}/${SubjectCode}/${date}/${Instructor}`)
        .then(response=>{
            return response.json();
        })
        .then(json=>{
            console.log(json);
        });        
    }

    render() {
        return (
            <div>
               <Table data={this.state.data} />
            </div>
        )
    }
}
